import React, { useState } from 'react';

const CreateEvent = () => {
  const [spaceName, setSpaceName] = useState('');
  const [location, setLocation] = useState('');
  const [capacity, setCapacity] = useState('');
  const [amenities, setAmenities] = useState('');
  const [rate, setRate] = useState('');
  const [image, setImage] = useState(null);
  const [submitted, setSubmitted] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmitted(true);
    // Add logic to handle form submission, e.g., sending data to a server
  };

  const handleImageChange = (e) => {
    setImage(e.target.files[0]);
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg-gray-100">
      <div className="bg-white p-6 rounded-lg shadow-lg max-w-md w-full mx-4 sm:mx-6 lg:mx-8 h-">
        <h2 className="text-2xl font-bold mb-4 text-center">Create a Space</h2>
        {!submitted ? (
          <form onSubmit={handleSubmit}>
            <div className="mb-4">
              <label htmlFor="image" className="block text-gray-700 text-sm font-bold mb-2">
                Image
              </label>
              <input
                type="file"
                id="image"
                onChange={handleImageChange}
                className="relative w-full"
              />
            </div>
            <div className="mb-4">
              <label htmlFor="spaceName" className="block text-gray-700 text-sm font-bold mb-2">
                Space Name
              </label>
              <input
                type="text"
                id="spaceName"
                value={spaceName}
                onChange={(e) => setSpaceName(e.target.value)}
                placeholder="Enter space name"
                className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
              />
            </div>
            <div className="mb-4">
              <label htmlFor="location" className="block text-gray-700 text-sm font-bold mb-2">
                Location
              </label>
              <input
                type="text"
                id="location"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                placeholder="Enter location"
                className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
              />
            </div>
            <div className="mb-4">
              <label htmlFor="capacity" className="block text-gray-700 text-sm font-bold mb-2">
                Capacity
              </label>
              <input
                type="text"
                id="capacity"
                value={capacity}
                onChange={(e) => setCapacity(e.target.value)}
                placeholder="Enter capacity"
                className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
              />
            </div>
            <div className="mb-4">
              <label htmlFor="amenities" className="block text-gray-700 text-sm font-bold mb-2">
                Amenities
              </label>
              <textarea
                id="amenities"
                value={amenities}
                onChange={(e) => setAmenities(e.target.value)}
                placeholder="Enter amenities"
                className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
              ></textarea>
            </div>
            <div className="mb-4">
              <label htmlFor="rate" className="block text-gray-700 text-sm font-bold mb-2">
                Rate (per hour)
              </label>
              <input
                type="text"
                id="rate"
                value={rate}
                onChange={(e) => setRate(e.target.value)}
                placeholder="Enter rate"
                className="px-3 py-2 placeholder-gray-400 text-gray-700 relative bg-white rounded text-sm shadow outline-none focus:outline-none focus:ring w-full"
              />
            </div>
            <button
              type="submit"
              className="bg-indigo-500 hover:bg-indigo-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline w-full"
            >
              Submit
            </button>
          </form>
        ) : (
          <div className="text-center">
            <p className="text-lg font-bold">Space created successfully!</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default CreateEvent;
